import React, {useState}  from "react";
import { Link } from "react-router-dom";
import './product.css'

const Product = (props) => {
    const {id, thumbnailUrl, title, shop} = props
    const [count, setCount] = useState(1)

    return (
        <div key={`key${id}`} className="col s3 ">
            {console.log(shop)}
            {shop}
            <div className="card post-card">
            <Link key={id} to={`${id-1}`}>
                    <img 
                        className="post-img" 
                        key={id+title} 
                        alt={id} 
                        src={thumbnailUrl}>
                    </img>
                    <p 
                        className="title-post" 
                        key={id}>
                        {title}
                    </p>
            </Link>

        </div>
        </div>
    )
}

export default Product;
